/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: 'Arial', sans-serif; font-size: 16px; }

/* Test-specific CSS */
.container {
    width: 400px;
    height: 300px;
    display: table;
    border: 2px solid #333;
    padding: 10px;
    border-spacing: 5px;
}
.row {
    display: table-row;
}
.cell {
    display: table-cell;
    padding: 10px;
    box-sizing: border-box;
    text-align: center;
    font-size: 14px;
    border: 1px solid #666;
    vertical-align: middle;
}
.cell:nth-child(1) { background-color: #ffcccc; }
.cell:nth-child(2) { background-color: #ccffcc; }
.cell:nth-child(3) { background-color: #ccccff; }
.rowspan-2 { 
    background-color: #ffccff !important;
    height: calc(200% + 5px);
    position: relative;
}
.rowspan-3 { 
    background-color: #ccffff !important;
    height: calc(300% + 10px);
    position: relative;
}
